import './App.css';
import HomePage from './components/HomePage';
import { Login } from './components/Login';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowseRouter>
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/login" element={<Login />} />
        </Routes>
      </BrowseRouter>

    </div>
  );
}

export default App;
